import React from 'react'
import './Image.css';
import Slider from 'react-slick';

export const Image = ({images}) => {


    return <Slider {...settings}>
        { images.map((image)=>(
        <div>
           <div className='photo'>
              <img  src={image.urls.small} alt='photo'></img>
           </div>
        </div>
    ))}
    </Slider>   
}
